INSERT INTO `emails` (`id`, `code`, `subject`, `content`, `attachment`, `status`, `updated_at`, `created_at`) VALUES
(1, 'user_registration', 'Welcome to Aora', 'Hi ::name::,\r\n\r\nWelcome to AORA! We’re excited for you to start shopping. Before you start clicking, we need you to verify your email address in the link below:\r\n\r\n::button_verify::\r\n\r\nIf you have any questions, feel free to chirp at us at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229.\r\nHappy shopping!\r\n\r\n::logo::\r\n\r\n*This verification email is valid for 48 hours only\r\nConnect with us here:\r\n::facebook_link::::twitter_link::::instagram_link::', NULL, 1, '2017-12-19 12:21:49', '2017-12-19 00:00:00'),
(2, 'forgot_password', 'Reset your password', 'Hi ::name::, \r\n\r\nWe’ve just received a request to reset your password for your AORA account. Visit the link below within 24 hours to reset your password and get back to the shopping game: \r\n\r\n::button_forgot_password::\r\n\r\nOr use this link here: ::link:: \r\n\r\nIf you did not request for this password reset, please ignore this email.\r\nFeel free to chirp at us anytime at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229 if you require further assistance. \r\nHappy shopping! \r\n\r\n::logo::', NULL, 1, '2017-12-19 15:08:57', '2017-12-19 12:23:45'),
(3, 'order_created', 'Payment is successfully processed', '<strong>Hi ::name::</strong>,\r\n\r\nYour payment has been received and is successfully processed! Our happy AORA hands are preparing to receive your product at our warehouse, and you’ll hear from us when it does.\r\nHere’s the summary of your order:\r\n\r\n<ul style="font-size: 15px;">\r\n       <li>Order ID: ::order_id::</li>\r\n       <li>Order Total: ::site_currency:: ::total_price::</li>\r\n       <li>Item(s) Ordered: ::count_products::</li>\r\n</ul>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Billing & Delivery Information</strong>\r\n<strong>Delivery Address:</strong>\r\n::shipping_address::\r\n<strong>Billing Address:</strong>\r\n::billing_address::</div>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Delivery Dates:</strong>\r\nShipment by ::shipping_method_name::: ::shipping_method_duration:: days</div>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Tracking code: 582 249 248</strong>\r\n\r\n::button_tracking::</div>\r\n\r\n<strong>Order Information</strong>\r\n::table_product_list::\r\n\r\nSubtotal: ::site_currency:: ::sub_total::\r\nShipping fee: ::site_currency:: ::shipping_fee::\r\nAORA Discount: -::site_currency:: ::aora_discount::\r\n<strong>Total: ::site_currency:: ::total::</strong>\r\n\r\nYou’ll hear from us again when your order has reached the warehouse. Have a great day ahead!\r\nSee you soon.\r\n\r\n::logo::', NULL, 1, '2018-01-16 16:20:12', '2017-12-19 16:58:21'),
(4, 'order_shipping', 'Order is received at warehouse & is being shipped out', '<strong>Hi ::name::</strong>\r\n\r\nShipment of your Order #::order_id:: has been shipped out from our warehouse, and is on its way to your doorstep.\r\nWe know you’re excited for your purchase to reach your hands. Track your order here, and let the anticipation bubble up!\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Your Package</strong>\r\n<strong>Delivery Details: </strong>::customer_name:: | Phone: ::customer_phone:: | Email address: ::customer_email::\r\n::shipping_address::\r\nShipment will arrive by: ::shipping_method_duration:: days\r\nShipment by: ::shipping_method_name::</div>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;">::button_tracking::\r\n\r\n<strong>Tracking code: 582 249 248</strong></div>\r\n\r\nIt’ll be in your hands soon.\r\n\r\n<strong>Order Information</strong>\r\n::table_product_list::\r\n\r\nIf you have any questions, feel free to chirp at us at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229.\r\nSee you soon, \r\n\r\n::logo::', NULL, 1, '2017-12-21 10:58:37', '2017-12-19 18:22:19'),
(5, 'order_arrived_sg', 'Order has reached SG & is almost arriving', '<strong>Hi ::name::</strong>\r\n\r\nShipment of your Order #::order_id:: has reached our Singapore warehouse, and will reach you in 1 – 3 working days. We cannot wait for you to receive your package. \r\n\r\n::table_product_list::\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Your Package</strong>\r\nShipment will arrive by: ::shipping_method_duration:: days\r\nShipment by: ::shipping_method_name::</div>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;">::button_tracking::\r\n\r\n<strong>Tracking code: 582 249 248</strong></div>\r\n\r\nIf you have any questions, feel free to chirp at us at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229.\r\nSee you soon, \r\n\r\n::logo::', NULL, 1, '2017-12-21 10:58:51', '2017-12-21 10:46:25'),
(6, 'order_leaving_usa', 'Order is successfully processed', '<strong>Hi ::name::</strong>,\r\n\r\nYour order has been successfully processed! Our happy AORA hands will be receiving your product at our warehouse, and you’ll be notified once your product is ready to ship to your address.\r\nHere’s the summary of your order:\r\n\r\n<ul style="font-size: 15px;">\r\n       <li>Order ID: ::order_id::</li>\r\n       <li>Order Total: ::site_currency:: ::total_price::</li>\r\n       <li>Item(s) Ordered: ::count_products::</li>\r\n</ul>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Billing & Delivery Information</strong>\r\n<strong>Delivery Address:</strong>\r\n::shipping_address::\r\n<strong>Billing Address:</strong>\r\n::billing_address::</div>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Delivery Dates:</strong>\r\nShipment by ::shipping_method_name::: ::shipping_method_duration:: days</div>\r\n\r\n<div style="background:#edeff2;padding:20px;font-size: 15px;"><strong>Tracking code: 582 249 248</strong>\r\n\r\n::button_tracking::</div>\r\n\r\n<strong>Order Information</strong>\r\n::table_product_list::\r\n\r\nSubtotal: ::site_currency:: ::sub_total::\r\nShipping fee: ::site_currency:: ::shipping_fee::\r\nAORA Discount: -::site_currency:: ::aora_discount::\r\n<strong>Total: ::site_currency:: ::total::</strong>\r\n\r\nYou’ll hear from us again when your order has reached the warehouse. Have a great day ahead!\r\nSee you soon.\r\n\r\n::logo::', NULL, 1, '2018-01-16 16:23:00', '2018-01-16 16:23:00');
