(8, 'order_arrived_sg', 24, 'loc.nd247@gmail.com', 'Order has reached SG & is almost arriving', '[AORA](http://ezbuy.me)\n\nHi Lộc Nguyễn\r\n\r\nShipment of your Order #2 has reached our Singapore warehouse, and will reach you in 1 – 3 working days. We cannot wait for you to receive your package. \r\n\r\nImageNamePriceQtyShippingApple iPhone 8 4.7", 256 GB, Fully Unlocked, GoldSGD 1,412.861StandardProduct CostSGD 1,412.86Shipping FeeSGD 13.40AORA DiscountSGD 127.16Sub TotalSGD 1,299.10\r\n\r\nYour Package\r\nShipment will arrive by: 4 - 6 days\r\nShipment by: Standard\r\n\r\nTrack Order\r\n\r\nTracking code: 582 249 248\r\n\r\nIf you have any questions, feel free to chirp at us at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229.\r\nSee you soon, \r\n\r\n\n\n© 2018 AORA. All rights reserved.\n', 0, '2018-03-08 03:29:14', '2018-03-08 03:29:14'),
(9, 'forgot_password', 0, 'loc.nd247@gmail.com', 'Reset your password', '[AORA](http://ezbuy.me)\n\nHi ::name::, \r\n\r\nWe’ve just received a request to reset your password for your AORA account. Visit the link below within 24 hours to reset your password and get back to the shopping game: \r\n\r\nReset Your Password Here\r\n\r\nOr use this link here: http://ezbuy.me/password/reset \r\n\r\nIf you did not request for this password reset, please ignore this email.\r\nFeel free to chirp at us anytime at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229 if you require further assistance. \r\nHappy shopping! \r\n\r\n\n\n© 2018 AORA. All rights reserved.\n', 0, '2018-03-09 03:10:03', '2018-03-09 03:10:03'),
(10, 'forgot_password', 0, 'loc.nd247@gmail.com', 'Reset your password', '[AORA](http://ezbuy.me)\n\nHi ::name::, \r\n\r\nWe’ve just received a request to reset your password for your AORA account. Visit the link below within 24 hours to reset your password and get back to the shopping game: \r\n\r\nReset Your Password Here\r\n\r\nOr use this link here: http://ezbuy.me/password/reset \r\n\r\nIf you did not request for this password reset, please ignore this email.\r\nFeel free to chirp at us anytime at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229 if you require further assistance. \r\nHappy shopping! \r\n\r\n\n\n© 2018 AORA. All rights reserved.\n', 0, '2018-03-09 03:12:00', '2018-03-09 03:12:00'),
(11, 'forgot_password', 0, 'loc.nd247@gmail.com', 'Reset your password', '[AORA](http://ezbuy.me)\n\nHi ::name::, \n\nWe’ve just received a request to reset your password for your AORA account. Visit the link below within 24 hours to reset your password and get back to the shopping game: \n\nReset Your Password Here\n\nOr use this link here: http://ezbuy.me/password/reset/996fcc12e9d3e73a86290f6e7d101741635f8b0ad80737be8b7bddb7059392aa \n\nIf you did not request for this password reset, please ignore this email.\nFeel free to chirp at us anytime at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229 if you require further assistance. \nHappy shopping! \n\n\n\n© 2018 AORA. All rights reserved.\n', 0, '2018-03-09 03:18:08', '2018-03-09 03:18:08'),
(12, 'user_registration', 29, 'loc.nd247@gmail.com', 'Welcome to Aora', '[AORA](http://ezbuy.me)\n\nHi demonew,\r\n\r\nWelcome to AORA! We’re excited for you to start shopping. Before you start clicking, we need you to verify your email address in the link below:\r\n\r\nVERIFY MY ACCOUNT >\r\n\r\nIf you have any questions, feel free to chirp at us at customerservice@aora.com.sg or ring us up during our office hours from 9am to 6pm at 6195 0229.\r\nHappy shopping!\r\n\r\n\r\n\r\n*This verification email is valid for 48 hours only\r\nConnect with us here:\r\n\n\n© 2018 AORA. All rights reserved.\n', 0, '2018-03-09 03:34:32', '2018-03-09 03:34:32');
